# -*- coding: utf-8 -*-
#------------------------------------------------------------------------------
# Manually-created memory-mapped ARM Cortex M0 internal registers IO file
#------------------------------------------------------------------------------
def missingReadMethod(*args, **kwargs):
   raise Exception("Need to implement read function")
def missingWriteMethod(*args, **kwargs):
   raise Exception("Need to implement write function")

READ_FUNC  = missingReadMethod
WRITE_FUNC = missingWriteMethod

class c_object(object):
   def __call__(self, *args, **kwargs):
      interactive = kwargs.get('interactive', True)
      if len(args) == 0:
         return self.read(interactive=interactive)
      elif len(args) == 1:
         return self.write(args[0])
      else:
         raise TypeError("%s() takes no arguments for read or 1 for write (%d given)" % (self.__class__, len(args)))

   def read(self, **kwargs):
      return self.value

   def write(self, *args, **kwargs):
      raise Exception("Cannot write to %s, only bits and registers" % self.__class__.__name__)

class c_enum(c_object):
   def __init__(self, parent, value, text, reg):
      self.parent = parent
      self.value  = value
      self.text   = text
      self.reg    = reg

class c_value(c_object):
   def __init__(self, parent, name, value, text):
      self.parent = parent
      self.name   = name
      self.value  = value
      self.text   = text

class c_bits(c_object):
   def __init__(self, parent, lsb, msb, mask, width, rw_flags, text):
      self.parent   = parent
      self.lsb      = lsb
      self.msb      = msb
      self.mask     = mask
      self.rw_flags = rw_flags
      self.width    = width
      self.text     = text

   def read(self, interactive=True):
      # we need to read the register and extract the bits we 'own'
      return (self.parent.read(interactive=False) & self.mask) >> self.lsb

   def write(self, value):
      # we do a read modify write of the parent register
      current   = self.parent.read(interactive=False)
      # clear the bits we care about
      current  |= self.mask
      current  -= self.mask
      # prepare the value
      value   <<= self.lsb
      value    &= self.mask
      current  |= value
      self.parent.write(current)
      return current

class c_reg(c_object):
   def __init__(self, addr, r, w, m, rw_flags, width, reset, local, ext_read, mod_name, group, text, locked_by, unlock_value, typedefd_io, safe_to_load, is_bank_ctrl, bank_ctrl_reg, constant):
      self.addr          = addr
      self.r             = r            # Readable
      self.w             = w            # Writeable
      self.m             = m            # Mixed register type
      self.rw_flags      = rw_flags     # RW flags
      self.width         = width
      self.local         = local
      self.ext_read      = ext_read
      self.mod_name      = mod_name
      self.text          = text
      self.group         = group
      self.reset         = reset
      self.locked_by     = locked_by
      self.unlock_value  = unlock_value
      self.safe_to_load  = safe_to_load
      self.typedefd_io   = typedefd_io
      self.is_bank_ctrl  = is_bank_ctrl
      self.bank_ctrl_reg = bank_ctrl_reg
      self.constant      = constant

   def read(self, interactive=True):
      # first check we can read this
      if not self.r:
         raise Exception("Trying to read a write only register")
      # read it
      value = READ_FUNC(self.addr)
      # if it has any bits use these
      if interactive:
         print("Register 0x%08X = 0x%08X (%d)" % (self.addr, value, value))
         bits = filter(lambda x: isinstance(x[1], c_bits), self.__dict__.items())
         bits.sort(lambda a,b: -1 if a[1].lsb < b[1].lsb else (a[1].lsb > b[1].lsb))
         for (name, b) in bits:
            v = (value & b.mask) >> b.lsb
            if b.lsb == b.msb:
               print("%-50s [%5d] : %10d (0x%08X)" % (name, b.lsb, v, v))
            else:
               print("%-50s [%2d-%2d] : %10d (0x%08X)" % (name, b.msb, b.lsb, v, v))
      else:
         return value

   def write(self, value, interactive=True):
      # first check we can write this
      if not self.w:
         raise Exception("Trying to write to a read only register")
      # write
      WRITE_FUNC(self.addr, value)
      return value

